import * as React from 'react';
import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import CssBaseline from '@mui/material/CssBaseline';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import List from '@mui/material/List';
import Typography from '@mui/material/Typography';
import Divider from '@mui/material/Divider';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import DashboardIcon from '@mui/icons-material/Dashboard';
import DeleteIcon from '@mui/icons-material/Delete';
import SettingsIcon from '@mui/icons-material/Settings';
import LogoutIcon from '@mui/icons-material/Logout';
import Logo from './logo.png';

const drawerWidth = 240;

export default function SideNav() {
  const [activeItem, setActiveItem] = React.useState('dashboard');

  const handleItemClick = (itemName) => {
    setActiveItem(itemName);
  };

  const DrawerListItem = ({ itemName, Icon }) => (
    <ListItem
      button
      key={itemName}
      selected={activeItem === itemName}
      onClick={() => handleItemClick(itemName)}
    >
      <ListItemIcon>{Icon}</ListItemIcon>
      <ListItemText primary={itemName.charAt(0).toUpperCase() + itemName.slice(1)} />
    </ListItem>
  );

  return (
    <Box sx={{ display: 'flex' }}>
      <CssBaseline />
      <AppBar position="fixed" sx={{ width: `calc(100% - ${drawerWidth}px)`, ml: `${drawerWidth}px` }}>
        <Toolbar>
          <img src={Logo} alt="Logo" style={{ height: '50px', marginRight: '16px' }} />
          <Typography variant="h6" noWrap component="div">
            My App
          </Typography>
        </Toolbar>
      </AppBar>
      <Drawer
        sx={{
          width: drawerWidth,
          flexShrink: 0,
          '& .MuiDrawer-paper': {
            width: drawerWidth,
            boxSizing: 'border-box',
            bgcolor: 'navy',
          },
        }}
        variant="permanent"
        anchor="left"
      >
        <Toolbar />
        <Divider />
        <List>
          <DrawerListItem itemName="dashboard" Icon={<DashboardIcon />} />
          <DrawerListItem itemName="trash" Icon={<DeleteIcon />} />
        </List>
        <Divider sx={{ bgcolor: 'white' }} />
        <List sx={{ flexGrow: 1 }} />
        <Divider sx={{ bgcolor: 'white' }} />
        <List>
          <DrawerListItem itemName="settings" Icon={<SettingsIcon />} />
          <DrawerListItem itemName="logout" Icon={<LogoutIcon />} />
        </List>
      </Drawer>
      <Box component="main" sx={{ flexGrow: 1, bgcolor: 'background.default', p: 3 }}>
        <Toolbar />
        <Typography paragraph>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et
          dolore magna aliqua. Rhoncus dolor purus non enim praesent elementum facilisis leo vel. Risus at ultrices mi
          tempus imperdiet. Semper risus in hendrerit gravida rutrum quisque non tellus. Convallis convallis tellus
          id interdum velit laoreet id donec ultrices. Odio morbi quis commodo odio aenean sed adipiscing. Amet nisl
          suscipit adipiscing bibendum

          gravida rutrum quisque non tellus orci ac. Pellentesque nec nam aliquam sem
          et tortor. Habitant morbi tristique senectus et. Adipiscing elit duis
          tristique sollicitudin nibh sit. Ornare aenean euismod elementum nisi quis
          eleifend. Commodo viverra maecenas accumsan lacus vel facilisis. Nulla
          posuere sollicitudin aliquam ultrices sagittis orci a.
        </Typography>
      </Box>
    </Box>
  );
}
